車庫入れなどの際に障害物の接近を知らせてくれるパーキングセンサー。センサーは表面がフラットになる埋め込みタイプで突起を最小限に抑えてます。 <br>4個のセンサーが付属するので左右角と中心に2箇所バンパーの角に設置できます。またセンサー取り付けに必要なホールソーも付属しています。前方または後方のどちらかへの施工になります。（1セットで前後には対応しません）<br>付属品：本体・コントローラー・センサー×4・専用ホールソー（工具） <br>ユニバーサル <br>　車検対応品<br>電装系/電装系その他<tr><td colspan="2">
